import React, { Component } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

class LocationForms extends Component {
  render() {
    return (
      <Form>
        <Form.Group controlId="formBasicDeparture">
          <Form.Label>Departure Location</Form.Label>
          <Form.Control type="input" placeholder="Enter departure stop" />
        </Form.Group>

        <Form.Group controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="input" placeholder="Enter arrival stop" />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    );
  }
}

export default LocationForms;
